import React from 'react';

import { CharacterList } from '../Components/CharacterList/CharacterList';

import { PlanetsList } from '../Components/PlanetList/PlanetList';


function Home() {
  return (
    <>
      
      <div className='container'>
        <CharacterList />
        <PlanetsList />
      </div>
    
    </>
  );
}

export default Home;
